void WatchFaceJesus::UpdateClock() {
  uint8_t hour = dateTimeController.Hours();
  uint8_t minute = dateTimeController.Minutes();
  uint8_t second = dateTimeController.Seconds();

  if (sMinute != minute) {
    auto const angle = minute * 6;
    
     minute_point_shadow[0] = CoordinateRelocateWithShadow(3, angle, ShadowOffsetX, ShadowOffsetY);
    minute_point_shadow[1] = CoordinateRelocateWithShadow(MinuteLength, angle, ShadowOffsetX, ShadowOffsetY);
    
    minute_point[0] = CoordinateRelocate(3, angle);
    minute_point[1] = CoordinateRelocate(MinuteLength, angle);
    
    lv_line_set_points(minute_shadow, minute_point_shadow, 2);
    lv_line_set_points(minute_body, minute_point, 2);
  }

  if (sHour != hour || sMinute != minute) {
    sHour = hour;
    sMinute = minute;
    auto const angle = (hour * 30 + minute / 2);

    hour_point_shadow[0] = CoordinateRelocateWithShadow(3, angle, ShadowOffsetX, ShadowOffsetY);
    hour_point_shadow[1] = CoordinateRelocateWithShadow(HourLength, angle, ShadowOffsetX, ShadowOffsetY);


    hour_point[0] = CoordinateRelocate(3, angle);
    hour_point[1] = CoordinateRelocate(HourLength, angle);
    
    lv_line_set_points(hour_shadow, hour_point_shadow, 2);
    lv_line_set_points(hour_body, hour_point, 2);
  }

  if (sSecond != second) {
    sSecond = second;
    auto const angle = second * 6;

 // Update second shadow
    second_point_shadow[0] = CoordinateRelocateWithShadow(-3, angle, ShadowOffsetX, ShadowOffsetY);
    second_point_shadow[1] = CoordinateRelocateWithShadow(SecondLength, angle, ShadowOffsetX, ShadowOffsetY);

    second_point[0] = CoordinateRelocate(-3, angle);
    second_point[1] = CoordinateRelocate(SecondLength, angle);
    lv_line_set_points(second_shadow, second_point_shadow, 2);
    lv_line_set_points(second_body, second_point, 2);
  }
}


void WatchFaceJesus::SetBatteryIcon() {
  auto batteryPercent = batteryPercentRemaining.Get();
  batteryIcon.SetBatteryPercentage(batteryPercent);
}

void WatchFaceJesus::Refresh() {
  isCharging = batteryController.IsCharging();
  if (isCharging.IsUpdated()) {
    if (isCharging.Get()) {
      lv_obj_set_hidden(batteryIcon.GetObject(), true);
      lv_obj_set_hidden(plugIcon, false);
    } else {
      lv_obj_set_hidden(batteryIcon.GetObject(), false);
      lv_obj_set_hidden(plugIcon, true);
      SetBatteryIcon();
    }
  }
  if (!isCharging.Get()) {
    batteryPercentRemaining = batteryController.PercentRemaining();
    if (batteryPercentRemaining.IsUpdated()) {
      SetBatteryIcon();
    }
  }

  bleState = bleController.IsConnected();
  if (bleState.IsUpdated()) {
    if (bleState.Get()) {
      lv_label_set_text_static(bleIcon, Symbols::bluetooth);
    } else {
      lv_label_set_text_static(bleIcon, "");
    }
  }

  notificationState = notificationManager.AreNewNotificationsAvailable();

  if (notificationState.IsUpdated()) {
    lv_label_set_text_static(notificationIcon, NotificationIcon::GetIcon(notificationState.Get()));
  }

  currentDateTime = dateTimeController.CurrentDateTime();
  if (currentDateTime.IsUpdated()) {
    UpdateClock();

    currentDate = std::chrono::time_point_cast<std::chrono::days>(currentDateTime.Get());
    if (currentDate.IsUpdated()) {
      lv_label_set_text_fmt(label_date_day, "%s\n%02i", dateTimeController.DayOfWeekShortToString(), dateTimeController.Day());
    }
  }
  heartbeat = heartRateController.HeartRate();
  heartbeatRunning = heartRateController.State() != Controllers::HeartRateController::States::Stopped;
  if (heartbeat.IsUpdated() || heartbeatRunning.IsUpdated()) {
    if (heartbeatRunning.Get()) {
      lv_obj_set_style_local_text_color(heartbeatIcon, LV_LABEL_PART_MAIN, LV_STATE_DEFAULT, lv_color_hex(0x815035));
      lv_label_set_text_fmt(heartbeatValue, "%d", heartbeat.Get());
    } else {
      lv_obj_set_style_local_text_color(heartbeatIcon, LV_LABEL_PART_MAIN, LV_STATE_DEFAULT, lv_color_hex(0x2C1F56));
      lv_label_set_text_static(heartbeatValue, "");
    }

    lv_obj_realign(heartbeatIcon);
    lv_obj_realign(heartbeatValue);
  }

  stepCount = motionController.NbSteps();
  if (stepCount.IsUpdated()) {
    lv_label_set_text_fmt(stepValue, "%lu", stepCount.Get());
    lv_obj_realign(stepValue);
    lv_obj_realign(stepIcon);
  }
}

